    dc:description """IT IS OF PARTICULAR IMPORTANCE THAT THE COMMISSION FOLLOW ITS USUAL PRACTICE AND CARRY OUT CONSULTATIONS WITH RELEVANT GROUPS OF EXPERTS ON MARITIME TRANSPORT AND ON INLAND WATERWAY TRANSPORT, INCLUDING EXPERTS FROM NATIONAL MARITIME OR INLAND NAVIGATION AUTHORITIES, BEFORE ADOPTING THOSE DELEGATED ACTS.""" ;
    polianna:paragraph [
        a polianna:Paragraph ;
        dc:description "Member States shall ensure that an appropriate number of CNG refuelling points accessible to the public are put in place by 31 December 2020, in order to ensure, in line with the sixth indent of Article 3(1), that CNG motor vehicles can circulate in urban/suburban agglomerations and other densely populated areas, and, where appropriate, within networks determined by the Member States." ;
    ] ;
    polianna:paragraph [
        a polianna:Paragraph ;
        dc:description "Member States shall ensure that an appropriate number of CNG refuelling points accessible to the public are put in place by 31 December 2025, at least along the existing TEN-T core network, to ensure that CNG motor vehicles can circulate throughout the Union." ;
    ] ;
    polianna:paragraph [
        a polianna:Paragraph ;
        dc:description "Member States shall ensure that CNG refuelling points for motor vehicles deployed or renewed as from 18 November 2017 comply with the technical specifications set out in point 3.4 of Annex II." ;
    ] ;
    polianna:paragraph [
        a polianna:Paragraph ;
        dc:description "Without prejudice to Regulation (EU) No 1025/2012, the Union shall pursue the development by the relevant European or international standardisation organisations of standards, including detailed technical specifications, for refuelling points for LNG and CNG motor vehicles." ;
    ] .

