    dc:description "Member States shall ensure that an appropriate number of CNG refuelling points accessible to the public are put in place by 31 December 2025, at least along the existing TEN-T core network, to ensure that CNG motor vehicles can circulate throughout the Union." ;
    polianna:hasTargetDate "2025-12-31"^^xsd:date .

<https://example.org/article6#requirement3> a polianna:Requirement ;
    dc:description "Member States shall ensure that CNG refuelling points for motor vehicles deployed or renewed as from 18 November 2017 comply with the technical specifications set out in point 3.4 of Annex II." ;
    polianna:hasTargetDate "2017-11-18"^^xsd:date .

